import React, { useEffect } from 'react';

function Predict() {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';
    script.async = true;
    document.getElementById('tableauVizContainer').appendChild(script);
  }, []);

  return (
    <div style={{ minHeight: '100vh', backgroundColor: '#fef2f2', padding: '2rem' }}>
      <h2 style={{ textAlign: 'center', color: '#7f1d1d', fontSize: '2rem', marginBottom: '1.5rem' }}>
        Earthquake Death Predictor
      </h2>

      {/* Streamlit App Embed */}
      <iframe
        src="http://localhost:8501"
        title="Streamlit Earthquake Predictor"
        width="100%"
        height="800px"
        style={{
          border: '1px solid #b91c1c',
          borderRadius: '12px',
          marginBottom: '3rem',
          backgroundColor: '#fef2f2',
        }}
      ></iframe>

      {/* Tableau Model Comparison Embed */}
      <div id="tableauVizContainer" style={{ textAlign: 'center' }}>
        <div
          className="tableauPlaceholder"
          id="viz1752087442535"
          style={{ position: 'relative', display: 'inline-block' }}
        >
          <noscript>
            <a href="#">
              <img
                alt="Dashboard 1"
                src="https://public.tableau.com/static/images/Mo/ModelComparisononEarthquakeData/Dashboard1/1_rss.png"
                style={{ border: 'none' }}
              />
            </a>
          </noscript>
          <object className="tableauViz" style={{ display: 'none' }}>
            <param name="host_url" value="https%3A%2F%2Fpublic.tableau.com%2F" />
            <param name="embed_code_version" value="3" />
            <param name="site_root" value="" />
            <param name="name" value="ModelComparisononEarthquakeData/Dashboard1" />
            <param name="tabs" value="no" />
            <param name="toolbar" value="yes" />
            <param name="static_image" value="https://public.tableau.com/static/images/Mo/ModelComparisononEarthquakeData/Dashboard1/1.png" />
            <param name="animate_transition" value="yes" />
            <param name="display_static_image" value="yes" />
            <param name="display_spinner" value="yes" />
            <param name="display_overlay" value="yes" />
            <param name="display_count" value="yes" />
            <param name="language" value="en-US" />
            <param name="filter" value="publish=yes" />
          </object>
        </div>
      </div>
    </div>
  );
}

export default Predict;
